import React from 'react';
import AddVehicle from './components/AddVehicle';
import SearchBook from './components/SearchBook';

export default function App() {
  return (
    <div style={{ padding: 20 }}>
      <h1>FleetLink</h1>
      <AddVehicle />
      <hr />
      <SearchBook />
    </div>
  );
}
